export default makeStyles((theme) => ({
    card: {
        backgroundColor: '#F1F6FC',
    },
    cardContent: {

    },
    cardContentIsi: {
        display:'flex',
    },
    areaData: {
        display: 'flex',
        flexDirection: 'column'
